if mibBuilder.loadTexts: ctAutoNegLocalTechnologyAbility.setDescription('This indicates the technology ability of the local hardware. The value is a sum. This sum initially takes the value zero. Then, for each technology, T, that the port supports, 2 raised to (T - 1) is added to the sum. For example, a port that supports 1000BASE-TFD (T = 18) and 1000BASE-T (T = 17) would return a value of 196608 ((2 ^ (18 - 1)) + (2 ^ (17 - 1))). For ports supporting Auto-Negotiation, values should be calculated as follows: T Technology Description -- ----------- ------------------------------------------------ 1 global Reserved for future use. 2 other None of the following. 3 unknown Initializing, true state or type not yet known 4 10BASE-T 10BASE-T Half Duplex 5 10BASE-TFD 10BASE-T Full Duplex 6 100BASE-T4 100BASE-T4 Half Duplex 7 100BASE-TX 100BASE-TX Half Duplex 8 100BASE-TXFD 100BASE-TX Full Duplex 9 FDX PAUSE Full Duplex Flow Control 10 FDX APAUSE Full Duplex Asymmetric Flow Control 11 FDX SPAUSE Full Duplex Symmetric Flow Control 12 FDX BPAUSE Full Duplex Asymmetric and Symmetric Flow Control 13 100BASE-T2 100BASE-T2 Half Duplex 14 100BASE-T2FD 100BASE-T2 Full Duplex 15 1000BASE-X 1000BASE-X Half Duplex 16 1000BASE-XFD 1000BASE-X Full Duplex 17 1000BASE-T 1000BASE-T Half Duplex 18 1000BASE-TFD 1000BASE-T Full Duplex 19 Rem Fault1 Remote Fault Bit 1 20 Rem Fault2 Remote Fault Bit 2 21 ISO Ethernet IEEE Std 802.9 ISLAN-16T ')
