if mibBuilder.loadTexts: ctEtherSupportedPauseModes.setDescription('This indicates the frame based modes of full duplex flow control for this port. The value is a sum. This sum initially takes the value zero. Then, for each mode, M, that the port supports, 2 raised to (M - 1) is added to the sum. For example, a port that supports Symmetric (M= 2), AsymmetricRX (M = 3) and AsymmetricTx (M = 4) would return a value of 14 ((2 ^ (2 - 1)) + (2 ^ (3 - 1)) + (2 ^ (4 - 1))). Speed values should be calculated as follows: M Mode Description -- ------------ ------------------------------------------------ 1 Other None of the following 2 Symmetric Receive and Transmit Pause Frames 3 AsymmetricRx Receive Pause Frames 4 AsymmetricTx Transmit Pause Frames ')
ctFlowCtlPauseAdminStatus = MibTableColumn((1, 3, 6, 1, 4, 1, 52, 4, 1, 2, 4, 2, 2, 1, 1, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))).clone(namedValues=NamedValues(("symmetric", 1), ("asymmetricRx", 2), ("asymmetricTx", 3), ("disabled", 4), ("autonegotiate", 5))).clone('autonegotiate')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: ctFlowCtlPauseAdminStatus.setStatus('mandatory')
if mibBuilder.loadTexts: ctFlowCtlPauseAdminStatus.setDescription('The administrative status requested by management for frame based flow control on this port. For 10 Mb and 100 Mb ports the value of symmetric(1) indicates that if Auto-Negotiation is supported for this port, that the FDX PAUSE bit in the ctAutoNegLocalTechnologyAbility will be set, further indicating that the port supports full duplex flow control. For 1000 Mb the value of symmetric(1) indicates that if Auto-Negotiation is supported for this port, that the FDX SPAUSE bit in the ctAutoNegLocalTechnologyAbility will be set, further indicating that the port supports symmetric frame based flow control. In all cases a set of symmetric(1) will cause the port to interpret received PAUSE frames and allow the port to transmit PAUSE frames when necessary. A set of a value of symmetric(1) is limited to those ports that support symmetric frame based flow control as specified by ctEtherSupportedPauseModes. The value of asymmetricRx(2) indicates that if Auto-Negotiation is supported for this port, that the FDX BPAUSE bit in the ctAutoNegLocalTechnologyAbility will be set, further indicating that the port supports asymmetric receive frame based flow control. In all cases a set of asymmetricRx(2) will cause the port to interpret received PAUSE frames and disallow the port to transmit PAUSE frames. A set of a value of asymmetricRx(2) is limited to those ports that support asymmetricRx frame based flow control as specified by ctEtherSupportedPauseModes. The value of asymmetricTx(3) indicates that if Auto-Negotiation is supported for this port, that the FDX APAUSE bit in the ctAutoNegLocalTechnologyAbility will be set, further indicating that the port supports asymmetric transmit frame based flow control. In all cases a set of asymmetricTx(3) will cause the port to ignore PAUSE frames and allow the port to transmit PAUSE frames when necessary. A set of a value of asymmetricTx(3) is limited to those ports that support asymmetricTx frame based flow control as specified by ctEtherSupportedPauseModes. The value of disabled(4) indicates that if Auto-Negotiation is supported for this port, that the FDX PAUSE, FDX APAUSE, FDX SPAUSE and FDX BPAUSE bits in the ctAutoNegLocalTechnologyAbility will be cleared, further indicating that the port does not support frame based flow control. In all cases a set of disable(2) will cause the port to ignore received PAUSE frames and to disallow the port to transmit PAUSE frames. The value of autonegotiate(5) indicates that if Auto-Negotiation is supported for this port, and the hardware supports the ability to advertise PAUSE capability, that the maximum flow control capabilities of the hardware are to be reflected in the PAUSE bits of ctAutoNegLocalTechnologyAbility. The ports flow control operational state will be determined by the results of Auto-Negotiation. If Auto-Negotiation is not supported for this port, a set of autonegotiate(5) will fail. In all cases frame based flow control is only used for ports that are in full duplex.')
